import React, {useState} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";



function Form({dash}){

  return(
    <div className="card mb-3" style={{maxWidth: "540px"}}>
      <div className="row g-0">
        <div className="col-md-4">
          <img src={`${dash.picturesRes_dash}`} class="img-fluid rounded-start" alt="dash-img" />
        </div>
      <div className="col-md-8">
       <div className="card-body">
        <h5 className="card-title">{`${dash.name_dash}`}</h5>
         <p className="card-text">{`${dash.location_dash}`}</p>
         <p className="card-text">{`${dash.decription_dash}`}</p>
         <p className="card-text">{`${dash.contact_dash}`}</p>
         <p className="card-text"><small className="text-muted">{`${dash.timings_dash}`}</small></p>
         </div>
      </div>
    </div>
    </div>
  )

}


export default Form;
